import{_ as A,o,c as K,b as F}from"./app.2874e34b.js";const i={},U=F('<img src="https://count-viewer.vercel.app//api/blog/view?url=https://creatipath.github.io/illustrator-short/section3.html" alt="Image 1" style="float:left;"><h1 id="_3-luu-y-khi-tu-hoc-thiet-ke-\u0111o-hoa-ai-cho-nguoi-moi-bat-\u0111au" tabindex="-1"><a class="header-anchor" href="#_3-luu-y-khi-tu-hoc-thiet-ke-\u0111o-hoa-ai-cho-nguoi-moi-bat-\u0111au" aria-hidden="true">#</a> 3. L\u01B0u \xFD khi t\u1EF1 h\u1ECDc Thi\u1EBFt k\u1EBF \u0111\u1ED3 h\u1ECDa AI cho ng\u01B0\u1EDDi m\u1EDBi b\u1EAFt \u0111\u1EA7u</h1><table><thead><tr><th>\xA0</th><th><strong>Adobe Illustrator CS6</strong></th><th><strong>Adobe Illustrator CC 2021</strong></th></tr></thead><tbody><tr><td>\u01AFu \u0111i\u1EC3m</td><td>\u2013 Dung l\u01B0\u1EE3ng c\xE0i \u0111\u1EB7t ch\u1EC9 1.6GB, c\u1EA5u h\xECnh m\xE1y b\u1EA3n c\xE0i kh\xF4ng cao 4GB;- T\u1ED1t nh\u1EA5t trong c\xE1c b\u1EA3n Adobe CS;- Giao di\u1EC7n tr\u1EF1c quan, th\xE2n thi\u1EC7n v\u1EDBi ng\u01B0\u1EDDi d\xF9ng, d\u1EC5 d\xE0ng t\xECm ki\u1EBFm c\xE1c c\xF4ng c\u1EE5;- \u0110\xEDnh k\xE8m nhi\u1EC1u gi\xE1o tr\xECnh h\u1ED7 tr\u1EE3 mi\u1EC5n ph\xED.</td><td>\u2013 Phi\xEAn b\u1EA3n Adobe Illustrator t\u1ED1t nh\u1EA5t hi\u1EC7n nay- \u0110a d\u1EA1ng ti\u1EC7n \xEDch \u0111\xEDnh k\xE8m: s\u1EED d\u1EE5ng th\u01B0 vi\u1EC7n \u0111\xE1m m\xE2y, tr\xEDch xu\u1EA5t d\u1EEF li\u1EC7u sang c\xE1c c\xF4ng c\u1EE5 kh\xE1c c\xF9ng b\u1ED9 Adobe Illustrator CC, c\xE1c m\u1EABu thi\u1EBFt k\u1EBF template c\xF3 s\u1EB5n,\u2026- T\xE0i li\u1EC7u h\u01B0\u1EDBng d\u1EABn \u0111a d\u1EA1ng</td></tr><tr><td>Nh\u01B0\u1EE3c \u0111i\u1EC3m</td><td>\u2013 T\u01B0\u01A1ng th\xEDch k\xE9m v\u1EDBi c\xE1c ph\u1EA7n m\u1EC1m kh\xE1c v\xEC kh\xF4ng \u0111\u01B0\u1EE3c c\u1EADp nh\u1EADt nh\u01B0 c\xE1c phi\xEAn b\u1EA3n Ai hi\u1EC7n t\u1EA1i \u0111\u1EC3 truy xu\u1EA5t d\u1EEF li\u1EC7u.- Ra \u0111\u1EDDi t\u1EEB n\u0103m 2016, nhi\u1EC1u t\xEDnh n\u0103ng \u0111\xE3 tr\u1EDF n\xEAn l\u1ED7i th\u1EDDi;- Kh\xF4ng c\xF3 nhi\u1EC1u video h\u01B0\u1EDBng d\u1EABn;</td><td>\u2013 Y\xEAu c\u1EA7u m\xE1y t\xEDnh c\u1EA5u h\xECnh \u0111\u1EE7 t\u1ED1t (dung l\u01B0\u1EE3ng RAM t\u1ED1i thi\u1EC3u 8GB cho m\u1ECDi t\xE1c v\u1EE5)</td></tr></tbody></table><p>3.1. C\xE1ch c\xE0i \u0111\u1EB7t phi\xEAn b\u1EA3n Adobe Illustrator ph\xF9 h\u1EE3p</p><p>Hi\u1EC7n nay, t\u1EADp \u0111o\xE0n Adobe ph\xE1t tri\u1EC3n hai ph\u1EA7n m\u1EC1m Adobe Illustrator Creative Suite \u2013 AI CS v\xE0 Adobe Illustrator Creative Cloud \u2013 AI CC v\u1EDBi giao di\u1EC7n v\xE0 ch\u1EE9c n\u0103ng kh\xE1</p><table><thead><tr><th><strong>Y\xEAu c\u1EA7u c\u1EA5u h\xECnh s\u1EED d\u1EE5ng Adobe Illustrator CC\u200B 2018</strong>B\u1ED9 vi x\u1EED l\xFD Intel Pentium 4 ho\u1EB7c AMD Athlon 64; Y\xEAu c\u1EA7u h\u1ED7 tr\u1EE3 64 bit\u200BRAM 1GB (khuy\u1EBFn kh\xEDch 3GB) cho 32 bit; RAM 2GB (t\u1ED1t nh\u1EA5t 8GB) cho 64 bit\u200B2GB dung l\u01B0\u1EE3ng \u1ED5 c\u1EE9ng s\u1EB5n c\xF3 \u0111\u1EC3 c\xE0i \u0111\u1EB7t\u200BM\xE0n h\xECnh 1024\xD7768 (khuy\u1EBFn kh\xEDch 1280\xD7800)\u200B\u0110\u1EC3 xem Illustrator \u1EDF ch\u1EBF \u0111\u1ED9 HiDPI, m\xE0n h\xECnh c\u1EE7a b\u1EA1n ph\u1EA3i h\u1ED7 tr\u1EE3 \u0111\u1ED9 ph\xE2n gi\u1EA3i 1920 x 1080 tr\u1EDF l\xEAn.\u200BOpenGL 4.x\u200B\u0110\u1EC3 s\u1EED d\u1EE5ng kh\xF4ng gian l\xE0m vi\u1EC7c Touch m\u1EDBi trong Illustrator, b\u1EA1n ph\u1EA3i c\xF3 m\xE1y t\xEDnh b\u1EA3ng / m\xE0n h\xECnh h\u1ED7 tr\u1EE3 c\u1EA3m \u1EE9ng ch\u1EA1y Windows 8.1 ho\u1EB7c Windows 10 (t\u1ED1t nh\u1EA5t l\xE0 Microsoft Surface Pro 3)\u200BT\xF9y ch\u1ECDn: \u0110\u1EC3 s\u1EED d\u1EE5ng GPU Performance: Intel, NVIDIA ho\u1EB7c b\u1ED9 \u0111i\u1EC1u h\u1EE3p video AMD h\u1ED7 tr\u1EE3; 1GB VRAM (t\u1ED1t nh\u1EA5t 2 GB); tr\xECnh \u0111i\u1EC1u khi\u1EC3n m\u1EDBi nh\u1EA5t cho hi\u1EC7u su\u1EA5t t\u1ED1i \u01B0u\u200B</th></tr></thead><tbody><tr><td><strong>Y\xEAu c\u1EA7u c\u1EA5u h\xECnh c\u1EE7a Photoshop cs 6</strong>CPU: Intel\xAE Pentium\xAE 4 or AMD Athlon\xAE 64 processorH\u0110H: Microsoft\xAE Windows\xAE XP with Service Pack 3 orMicrosoft Windows 7 with Service Pack 1. Adobe\xAE Creative Suite\xAE 5.5 and CS6 applications also support Windows 8 and Windows 8.1. See the CS6 FAQ for more information about Windows 8 support.*RAM: 1 GB of RAM\u1ED4 C\u1EE9ng: 1 GB \u0111\u0129a tr\u1ED1ng; (kh\xF4ng c\xE0i PTS v\xE0o USB)VGA: 1024 x 768 (\u0111\u1EC1 ngh\u1ECB 1280\xD7800) v\u1EDBi 16-bit color \u2013 512 MB of VRAM (\u0111\u1EC1 ngh\u1ECB 1 GB)*OpenGL 2.0\u2013capable systemK\u1EBFt n\u1ED1i internet \u0111\u1EC3 \u0111\u0103ng k\xFD v\xE0 k\xEDch ho\u1EA1t b\u1EA3n quy\u1EC1n.</td></tr><tr><td><strong>Y\xEAu c\u1EA7u c\u1EA5u h\xECnh c\u1EE7a Photoshop cc 2015</strong>CPU: Intel\xAE Core 2 or AMD Athlon\xAE 64 processor; 2 GHz tr\u1EDF l\xEAnH\u0110H: Windows 7 with Service Pack 1, Windows 8.1, or Windows 10RAM: 2 GB (\u0111\u1EC1 ngh\u1ECB 8 GB)\u1ED4 C\u1EE9ng: 2 GB \u0111\u0129a tr\u1ED1ng cho b\u1EA3n 32-bit; 2.1 GB cho b\u1EA3n 64-bit; (kh\xF4ng c\xE0i PTS v\xE0o USB)VGA: 1024 x 768 (\u0111\u1EC1 ngh\u1ECB 1280\xD7800) v\u1EDBi 16-bit color \u2013 512 MB of VRAM (\u0111\u1EC1 ngh\u1ECB 1 GB)* <br>Ch\xFAc n\u0103ng 3D s\u1EBD b\u1ECB \u1EA9n n\u1EBFu VGA \xEDt h\u01A1n 512MBOpenGL 2.0\u2013capable systemK\u1EBFt n\u1ED1i internet \u0111\u1EC3 \u0111\u0103ng k\xFD v\xE0 k\xEDch ho\u1EA1t b\u1EA3n quy\u1EC1n.</td></tr></tbody></table><p>t\u01B0\u01A1ng \u0111\u1ED3ng. Arena Multimedia s\u1EBD gi\xFAp b\u1EA1n ph\xE2n bi\u1EC7t 2 ph\u1EA7n m\u1EC1m c\xF9ng nh\u1EEFng phi\xEAn b\u1EA3n m\u1EDBi nh\u1EA5t c\u1EE7a ch\xFAng.</p><p>N\u1EBFu nh\u01B0 b\u1EA1n ch\u01B0a c\xF3 \u0111i\u1EC1u ki\u1EC7n \u0111\u1EA7u t\u01B0 m\xE1y t\xEDnh, b\u1EA1n c\xF3 th\u1EC3 c\xE0i \u0111\u1EB7t phi\xEAn b\u1EA3n th\u1EA5p h\u01A1n c\u1EE7a ph\u1EA7n m\u1EC1m n\xE0y l\xE0 Adobe Illustrator CS6 v\xE0 CC 2018 hay CC 2015.</p><p>M\u1ED9t s\u1ED1 c\u1EA5u h\xECnh m\xE1y t\xEDnh v\xE0 phi\xEAn b\u1EA3n Adobe Illustrator y\xEAu c\u1EA7u \u0111\u1EC3 b\u1EA1n tham kh\u1EA3o:</p><p>3.2. K\xEAnh th\xF4ng tin cho ng\u01B0\u1EDDi t\u1EF1 h\u1ECDc Thi\u1EBFt k\u1EBF \u0111\u1ED3 h\u1ECDa Adobe Illustrator</p><p>N\u1EBFu t\u1ED1t v\u1EC1 ti\u1EBFng anh s\u1EBD l\xE0 m\u1ED9t l\u1EE3i th\u1EBF l\u1EDBn \u0111\u1EC3 b\u1EA1n h\u1ECDc h\u1ECFi \u0111\u01B0\u1EE3c c\xE1c c\xF4ng c\u1EE5 tr\u1EF1c ti\u1EBFp ngay tr\xEAn b\xE0i gi\u1EA3ng h\u01B0\u1EDBng d\u1EABn c\u1EE7a Adobe v\u1EDBi nhi\u1EC1u b\u1EA3n c\u1EADp nh\u1EADt s\u1EB5n c\xF3: <a href="https://helpx.adobe.com/illustrator/tutorials.html" target="_blank" rel="noopener noreferrer"><strong>https://helpx.adobe.com/illustrator/tutorials.html</strong></a></p><p><img src="data:image/jpeg;base64," alt="kh\xF3a h\u1ECDc Adobe Illustrator online c\u1EE7a Adobe"></p><p>Ngo\xE0i ra, Tastytuts l\xE0 m\u1ED9t trang web chia s\u1EBB ki\u1EBFn th\u1EE9c r\u1EA5t h\u1EEFu \xEDch m\xE0 b\u1EA1n c\xF3 th\u1EC3 tham kh\u1EA3o. B\u1EA1n s\u1EBD \u0111\u01B0\u1EE3c h\u1ECDc theo nh\u1EEFng ch\u01B0\u01A1ng (chapter) c\u1EE5 th\u1EC3 v\u1EDBi nh\u1EEFng b\xE0i th\u1EF1c h\xE0nh chi ti\u1EBFt:</p><p><img src="data:image/png;base64," alt="H\u01B0\u1EDBng d\u1EABn h\u1ECDc Adobe Illustrator c\u1EE7a Tastytuts cho ng\u01B0\u1EDDi m\u1EDBi b\u1EAFt \u0111\u1EA7u "></p><p>H\u01B0\u1EDBng d\u1EABn h\u1ECDc Adobe Illustrator c\u1EE7a <a href="https://www.pgsd.org/cms/lib07/PA01916597/Centricity/Domain/202/illustrator_for_beginners_tastytuts.pdf" target="_blank" rel="noopener noreferrer"><strong>Tastytuts</strong></a> cho ng\u01B0\u1EDDi m\u1EDBi b\u1EAFt \u0111\u1EA7u</p><p>Tuy nhi\xEAn, \u0111\u1EC3 th\xE0nh th\u1EA1o c\xE1c k\u1EF9 n\u0103ng s\u1EED d\u1EE5ng ph\u1EA7n m\u1EC1m Ai \u0111\u1EC3 thi\u1EBFt k\u1EBF \u0111\u1ED3 h\u1ECDa c\u1EA7n c\xF3 s\u1EF1 r\xE8n luy\u1EC7n trong trong th\u1EDDi gian nh\u1EA5t \u0111\u1ECBnh. B\u1EA1n c\xF3 th\u1EC3 tham gia c\xE1c kh\xF3a h\u1ECDc v\u1EDBi nh\u1EEFng gi\xE1o tr\xECnh \u0111\u01B0\u1EE3c thi\u1EBFt k\u1EBF s\u1EB5n, gi\xFAp qu\xE1 tr\xECnh th\u1EF1c h\xE0nh d\u1EC5 d\xE0ng h\u01A1n.</p><p><img src="data:image/jpeg;base64," alt="M\u1ED9t thi\u1EBFt k\u1EBF \u0111\u1ED3 h\u1ECDa logo nh\u1EADn di\u1EC7n th\u01B0\u01A1ng hi\u1EC7u v\u1EDBi Adobe Illustrator"><em>M\u1ED9t thi\u1EBFt k\u1EBF logo nh\u1EADn di\u1EC7n th\u01B0\u01A1ng hi\u1EC7u v\u1EDBi Adobe Illustrator. (Ngu\u1ED3n: \u0110\u1ED3 \xE1n B\u1ED9 nh\u1EADn di\u1EC7n th\u01B0\u01A1ng hi\u1EC7u c\u1EE7a h\u1ECDc vi\xEAn Arena Multimedia Tr\u1EA7n Ph\xFA)</em></p><p>M\u1EB7t kh\xE1c, n\u1EBFu b\u1EA1n y\xEAu th\xEDch v\xE0 c\xF3 \xFD \u0111\u1ECBnh theo \u0111u\u1ED5i <a href="https://www.arena-multimedia.vn/tin-multimedia/nganh-thiet-ke-do-hoa/" target="_blank" rel="noopener noreferrer">ngh\u1EC1 Thi\u1EBFt k\u1EBF \u0111\u1ED3 h\u1ECDa</a>, b\u1EA1n n\xEAn c\xF3 s\u1EF1 \u0111\u1EA7u t\u01B0 h\u1ECDc b\xE0i b\u1EA3n v\u1EDBi x\xE2y d\u1EF1ng b\u1ED1 c\u1EE5c t\xE1c ph\u1EA9m, h\xECnh th\xE0nh v\xE0 n\xE2ng t\u01B0 duy th\u1EA9m m\u1EF9 b\u1EB1ng nh\u1EEFng l\u1EDBp h\u1ECDc thi\u1EBFt k\u1EBF chuy\xEAn bi\u1EC7t.</p>',18),R=[U];function f(w,t){return o(),K("div",null,R)}var a=A(i,[["render",f],["__file","section3.html.vue"]]);export{a as default};
